import React from 'react';
import './Home.css';

function Home() {
    return (
        <div className="hero">
            <div className="hero-content">
                <h1>Welcome to HomeAwake</h1>
                <p>Innovative home automation systems to make your life easier.</p>
                <button className="cta-button">Get Started</button>
            </div>
        </div>
    );
}

export default Home;
